import React from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from './AuthContext';
import logo from '../assets/logo.png'; // Make sure logo.png is placed in src/assets
import '../styles/Navbar.css'; // Update the path if needed

function Navbar() {
  const { user, logout } = useAuth();

  return (
    <nav className="navbar">
      <div className="navbar-logo">
        <Link to="/">
          <img src={logo} alt="TripGo Logo" style={{ height: '40px' }} />
        </Link>
      </div>
      <div className="navbar-links">
        <Link to="/">Home</Link>

        {user ? (
          <>
            <Link to="/dashboard">Dashboard</Link>
            <Link to="/faq">FAQ</Link>
            <button
              onClick={logout}
              style={{
                background: 'transparent',
                color: '#f47c00',
                border: 'none',
                fontWeight: 'bold',
                cursor: 'pointer',
                marginLeft: '16px',
              }}
            >
              Logout
            </button>
          </>
        ) : (
          <>
            <Link to="/login">Login</Link>
            <Link to="/signup">Signup</Link>
          </>
        )}
      </div>
    </nav>
  );
}

export default Navbar;
